    code:
      "/*\n Assuming you have installed fusioncharts using npm \n Following code snippet can be used to render chart.\n*/\nvar FusionCharts = require('fusioncharts');\nvar TimeSeries = require('fusioncharts/fusioncharts.timeseries');\nvar $ = require('jquery');\nvar jQueryFusionCharts = require('jquery-fusioncharts');\n\nTimeSeries(FusionCharts); // Resolve Charts as dependency for FusionCharts.\njQueryFusionCharts(FusionCharts); // Resolve FusionCharts as dependency for jqueryFusionCharts.\n\nvar jsonify = res => res.json();\nvar dataFetch = fetch(\n  'https://s3.eu-central-1.amazonaws.com/fusion.store/ft/data/single-event-overlay-data.json'\n).then(jsonify);\nvar schemaFetch = fetch(\n  'https://s3.eu-central-1.amazonaws.com/fusion.store/ft/schema/single-event-overlay-schema.json'\n).then(jsonify);\n\nPromise.all([dataFetch, schemaFetch]).then(res => {\n  const data = res[0];\n  const schema = res[1];\n  // First we are creating a DataStore\n  const fusionDataStore = new FusionCharts.DataStore();\n  // After that we are creating a DataTable by passing our data and schema as arguments\n  const fusionTable = fusionDataStore.createDataTable(data, schema);\n\n  $('document').ready(function() {\n    $('#chart-container').insertFusionCharts({\n      type: 'timeseries',\n      width: '600',\n      height: '400',\n      dataFormat: 'json',\n      dataSource: {\n        data: fusionTable,\n        caption: {\n          text: 'Interest Rate Analysis'\n        },\n        subCaption: {\n          text: 'Federal Reserve (USA)'\n        },\n        yAxis: [\n          {\n            plot: 'Interest Rate',\n            format: {\n              suffix: '%'\n            },\n            title: 'Interest Rate'\n          }\n        ],\n        xAxis: {\n          plot: 'Time',\n          timemarker: [\n            {\n              start: 'Mar-1980',\n              label: 'US inflation peaked at 14.8%.',\n              timeFormat: '%b-%Y',\n              style: {\n                marker: {\n                  fill: '#D0D6F4'\n                }\n              }\n            },\n            {\n              start: 'May-1981',\n              label:\n                'To control inflation, the Fed started {br} raising interest rates to over {br} 20%.',\n              timeFormat: '%b-%Y'\n            },\n            {\n              start: 'Jun-1983',\n              label:\n                'By proactive actions of Mr.Volcker, {br} the inflation falls to 2.4% {br} from the peak of over 14% {br} just three years ago.',\n              timeFormat: '%b-%Y',\n              style: {\n                marker: {\n                  fill: '#D0D6F4'\n                }\n              }\n            },\n            {\n              start: 'Oct-1987',\n              label:\n                'The Dow Jones Industrial Average lost {br} about 30% of it’s value.',\n              timeFormat: '%b-%Y',\n              style: {\n                marker: {\n                  fill: '#FBEFCC'\n                }\n              }\n            },\n            {\n              start: 'Jan-1989',\n              label:\n                'George H.W. Bush becomes {br} the 41st president of US!',\n              timeFormat: '%b-%Y'\n            },\n            {\n              start: 'Aug-1990',\n              label:\n                'The oil prices spiked to $35 {br} per barrel from $15 per barrel {br} because of the Gulf War.',\n              timeFormat: '%b-%Y'\n            },\n            {\n              start: 'Dec-1996',\n              label:\n                'Alan Greenspan warns of the dangers {br} of \"irrational exuberance\" in financial markets, {br} an admonition that goes unheeded',\n              timeFormat: '%b-%Y'\n            },\n            {\n              start: 'Sep-2008',\n              label: 'Lehman Brothers collapsed!',\n              timeFormat: '%b-%Y'\n            },\n            {\n              start: 'Mar-2009',\n              label:\n                'The net worth of US households {br} stood at a trough of $55 trillion.',\n              timeFormat: '%b-%Y',\n              style: {\n                marker: {\n                  fill: '#FBEFCC'\n                }\n              }\n            },\n            {\n              start: 'Oct-2009',\n              label:\n                'Unemployment rate peaked {br} in given times to 10%.',\n              timeFormat: '%b-%Y'\n            }\n          ]\n        }\n      }\n    });\n  });\n});\n\n/* NOTE:\n * In case you downloaded fusioncharts in zipped format\n * var FusionCharts = require('/path/to/fusioncharts/fusioncharts.js');\n * var TimeSeries = require('/path/to/fusioncharts/fusioncharts.timeseries.js');\n */\n",
