    code:
      "/*\n Assuming you have installed fusioncharts using npm \n Following code snippet can be used to render chart.\n*/\nvar FusionCharts = require('fusioncharts');\nvar TimeSeries = require('fusioncharts/fusioncharts.timeseries');\nvar $ = require('jquery');\nvar jQueryFusionCharts = require('jquery-fusioncharts');\n\nTimeSeries(FusionCharts); // Resolve Charts as dependency for FusionCharts.\njQueryFusionCharts(FusionCharts); // Resolve FusionCharts as dependency for jqueryFusionCharts.\n\nvar jsonify = res => res.json();\nvar dataFetch = fetch(\n  'https://s3.eu-central-1.amazonaws.com/fusion.store/ft/data/date-range-event-overlay-data.json'\n).then(jsonify);\nvar schemaFetch = fetch(\n  'https://s3.eu-central-1.amazonaws.com/fusion.store/ft/schema/date-range-event-overlay-schema.json'\n).then(jsonify);\n\nPromise.all([dataFetch, schemaFetch]).then(res => {\n  const data = res[0];\n  const schema = res[1];\n  // First we are creating a DataStore\n  const fusionDataStore = new FusionCharts.DataStore();\n  // After that we are creating a DataTable by passing our data and schema as arguments\n  const fusionTable = fusionDataStore.createDataTable(data, schema);\n\n  $('document').ready(function() {\n    $('#chart-container').insertFusionCharts({\n      type: 'timeseries',\n      width: '600',\n      height: '400',\n      dataFormat: 'json',\n      dataSource: {\n        data: fusionTable,\n        caption: {\n          text: 'Interest Rate Analysis'\n        },\n        subCaption: {\n          text: 'Federal Reserve (USA)'\n        },\n        yAxis: [\n          {\n            plot: 'Interest Rate',\n            format: {\n              suffix: '%'\n            },\n            title: 'Interest Rate'\n          }\n        ],\n        xAxis: {\n          plot: 'Time',\n          timemarker: [\n            {\n              start: 'Jul-1981',\n              end: 'Nov-1982',\n              label:\n                'Economic downturn was triggered by {br} tight monetary policy in an effort to {br} fight mounting inflation.',\n              timeFormat: '%b-%Y'\n            },\n            {\n              start: 'Jul-1990',\n              end: 'Mar-1991',\n              label:\n                'This eight month recession period {br} was characterized by a sluggish employment recovery, {br} most commonly referred to as a jobless recovery.',\n              timeFormat: '%b-%Y'\n            },\n            {\n              start: 'Jun-2004',\n              end: 'Jul-2006',\n              label:\n                'The Fed after raising interest rates {br} at 17 consecutive meetings, ends its campaign {br} to slow the economy and forestall inflation.',\n              timeFormat: '%b-%Y'\n            },\n            {\n              start: 'Dec-2007',\n              end: 'Jun-2009',\n              label:\n                'Recession caused by the worst {br} collapse of financial system in recent {br} times.',\n              timeFormat: '%b-%Y'\n            }\n          ]\n        }\n      }\n    });\n  });\n});\n\n/* NOTE:\n * In case you downloaded fusioncharts in zipped format\n * var FusionCharts = require('/path/to/fusioncharts/fusioncharts.js');\n * var TimeSeries = require('/path/to/fusioncharts/fusioncharts.timeseries.js');\n */\n",
